import React from "react";
import Match from "./Match";
import Notmatch from "./Notmatch";



const SlotM = (props) =>
{
   
     let x=props.x;
     let y=props.y;
     let z=props.z;

     if((x==y)&&(y==z))
     {
        return (
            <>
            <h1>
                        {x} {y} {z}
                    </h1>
              <Match/>
            </>
        );
     }
     else{
        return (
            <>
               <Notmatch/>
            </>
        );
     }

}

export default SlotM;
